import React, {useState} from "react";
import ExpenseItems from "./ExpenseItems";
import ExpenseFilter from "./ExpenseFilter";
import './ExpenseList.css' ;

function ExpenseList (props) {

    const [ year, setYear ] = useState('2022')

    const onChangeYear = (selectedYear) => {
        setYear(selectedYear)
        //console.log(year)
    }

    return (
        <div>
            <ExpenseFilter onChangeYear={onChangeYear}/>
            <div className="expenses">
                {
                    props.expense.map((expense, i) => {
                        return (
                            <ExpenseItems 
                                amount={props.expense[i].amount} 
                                title={props.expense[i].title} 
                                date={props.expense[i].date}
                                key={props.expense[i].id}
                            /> 
                        )
                    })
                }
            </div>
        </div>
    )
}

export default ExpenseList;
